class Solution:
    def countPalindromicSubsequence(self, s: str) -> int:
        if not s or len(s) == 0:
            return 0
        pali = set()
        count = dict()
        for mid in range(1, len(s) - 1):
            for i in range(0, mid):
                if not count.get(s[i] + s[mid]):
                    for j in range(mid + 1, len(s)):
                        if self.isPal(s, i, j):
                            pali.add(s[i] + s[mid] + s[j])
                            count[s[i] + s[mid]] = 1
        return len(pali)

    def isPal(self, s, i, j):
        return s[i] == s[j]


